import React from 'react';
import Navbar from './Navbar';
import { useNavigate } from 'react-router-dom';
function Dashbaord() {
    const navigate = useNavigate();
    if (localStorage.getItem('isAutenticated')) {
        return (
            <div>
                <Navbar />
                <div>Dashboard</div>
            </div>
        )
    } else {
        navigate("/");
    }

}

export default Dashbaord;
